import React,{useState} from 'react'
import DashboardHeader from './DashboardHeader'
import DashboardIntro from './DashboardIntro'
import DashboardOutro from './DashboardOutro'
import ExpenseTracker from './Expence/ExpenseTracker'
import Button from '../Button'


function Dashboard(){
    const [view, setView] = useState([
        {
            dash:"dash-intro",
            visibility: true
        },
        {
            dash:"dash-outro",
            visibility: false
        },
        {
            dash:"dash-exp",
            visibility: false
        }
    ]);
    function handleView(newView){
        setView(newView)
    }
    return (
        <>
            <div className="dashboard-content">
                <DashboardHeader method={handleView} viewType={view}/>
                {/* <DashboardIntro viewDash={view[0]}/>
                <DashboardOutro viewDash={view[1]}/>
                <ExpenseTracker  viewDash={view[2]}/> */}
            </div>
            <div className="add-expense-modal">
                <div className="add-expense-1">
                    <p>Add an expense</p>
                    <Button class="close-btn" name="x"/>
                </div>
                <div className="add-expense-2">
                    <Button class="" name="Cancel"/>
                    <Button class="" name="Save"/>
                </div> 
            </div>
        </>
    )
}

export default Dashboard
